	    // 返回:
	    // [{"SerialNum":"2016042011210411817839","ProjectName":"元数据监控","PrototypeImg":":10080/xplan/images/release/2016/5/31/599175.png","ProjectBrief":"       元数据被定义为：描述数据的数据，对数据及信息资源的描述性信息。在数据仓库领域中，元数据按用途分成技术元数据和业务元数据。元数据不仅能提供基于用户的信息，如记录数据项的业务描述信息的元数据能帮助用户使用数据。而且, 元数据能支持系统对数据的管理和维护，如关于数据项存储方法的元数据能支持系统以最有效的方式访问数据。\n       大数据平台技术框架有很多不同类型的程序（任务）运行在大数据平台之上。这些任务需要不同的运行环境，并且除了定时运行，各种类型之间的任务存在依赖关系，目前各业务的数据任务基本都是靠Crontab定时调度，各个任务之间的依赖仅靠简单的串行来实现。为此需要一个统一个监控页面来保证全业务的正常运行。","PrototypeView":" http://10.5.0.128/ZXVMAX/DOC/UX/原型/元数据监控2/功能面板.html"},{"SerialNum":"2016042017072498025060","ProjectName":"单用户感知端到端","PrototypeImg":":10080/xplan/images/release/2016/5/31/521162.png","ProjectBrief":" 单用户体验的只管体现, 查看重点用户的感知体验. 及时发下问题. 解决问题","PrototypeView":"http://10.5.0.128/ZXVMAX/DOC/UX/原型/单用户感知评估端到端20151123/index.html"},{"SerialNum":"2016050911494017965890","ProjectName":"元数据系统参数配置","PrototypeImg":":10080/xplan/images/release/2016/6/1/1464744764208","ProjectBrief":"用于指导版本升级或安装后，元数据平台的环境必配系统参数配置界面\n1、所有填写数据的校验在填写完成后立刻校验\n2、省份的选择建议可出省份列表，自动匹配区号\n","PrototypeView":"http://10.5.0.128/ZXVMAX/DOC/UX/原型/元数据-系统参数配置/start_c_1.html"},{"SerialNum":"2016051109385377012483","ProjectName":"关联分析参数管理/待优化任务","PrototypeImg":":10080/xplan/images/release/2016/5/31/529612.png","ProjectBrief":"       当核心网侧某项业务指标（例如针对上网速率低识别出TCP无线建链时延大）恶化时，如果定界出是无线侧问题引起，则希望找出导致业务指标恶化的主要无线侧KPI指标，以进行小区参数调整或网络优化。传统解决方法主要依靠人工经验，面对多达几百条的小区KPI、上报参数MR、告警信息、辅助消息，及时准确地排查问题比较困难。\n       关联分析需求的目标，就是通过算法自动计算出跟每项核心网KQI指标最相关的几项无线侧KPI指标，并生成关联矩阵，这样就可以在某项KQI指标有问题时，快速定位出无线侧存在问题的指标，并进行优化。\n生成关联矩阵以后，还可以通过无线侧KPI数据和关联矩阵来预判KQI是否超限，并筛选出有问题的小区，然后通过\u201c智能优化\u201d功能来对小区进行优化。\n       本功能可实现根据无线侧KPI数据自动将问题小区筛选出来并添加到\u201c智能优化\u201d功能的\u201c待优化\u201d列表中，以方便用户直接启动针对问题小区的智能优化流程。","PrototypeView":"http://10.5.0.128/ZXVMAX/DOC/UX/%E5%8E%9F%E5%9E%8B/%E5%85%B3%E8%81%94%E5%88%86%E6%9E%90/%E5%85%B3%E8%81%94%E5%88%86%E6%9E%90%E5%8F%82%E6%95%B0.html"},{"SerialNum":"2016052309333056880054","ProjectName":"潜在离网客户预测","PrototypeImg":":10080/xplan/images/release/2016/5/31/545384.png","ProjectBrief":"在电信服务业竞争日趋激烈，市场日趋饱和的大背景下，已有客户的离网流失将给电信运营商带来巨大的损失。及时识别、发现具有潜在离网倾向的客户，分析导致其离网的根本原因，并采取积极有效的客户维挽措施，有效降低客户流失率，对电信运营商增加营收具有重大意义。","PrototypeView":"http://10.5.0.128/ZXVMAX/DOC/UX/原型/潜在离网用户预测/publish/index.html"},{"SerialNum":"2016052310035569361592","ProjectName":"重庆SOC监控","PrototypeImg":":10080/xplan/images/release/2016/6/1/1464745493089","ProjectBrief":"以业务、区域、用户为重点，以监控作为入口，对系统的业务质量进行实时监控。并对问题进行端到端定界定位，通过工单系统跟踪直到问题得到验证解决。","PrototypeView":""},{"SerialNum":"2016052314274351411994","ProjectName":"元数据建模","PrototypeImg":":10080/xplan/images/release/2016/6/1/1464746573017","ProjectBrief":"    基于现有的元数据管理平台，业务功能数据预处理的开发过程由以前的开发人员写Scala代码过渡到由开发人员写元数据xml文件。元数据建模工具旨在使开发人员通过图形化的操作来完成xml文件的编写，降低开发难度并提高开发效率。","PrototypeView":"http://10.5.0.128/ZXVMAX/DOC/UX/%E5%8E%9F%E5%9E%8B/%E5%85%83%E6%95%B0%E6%8D%AE-%E6%95%B0%E6%8D%AE%E5%BB%BA%E6%A8%A1/%E5%85%83%E6%95%B0%E6%8D%AE%E5%BB%BA%E6%A8%A1.html"},{"SerialNum":"2016052518020113939730","ProjectName":"弱覆盖分析改版","PrototypeImg":":10080/xplan/images/release/2016/5/31/3.png","ProjectBrief":"重庆进行集中最小系统功能优化设计\n\n功能分为两个页面：\nP1是概览信息页，显示一些主要的信息，不期望用户在这个页面上做更多操作，定位就是看到后对弱覆盖有个总览。\nP2定位是详情页。\n\n设计思路、联动逻辑：\n1.P1页有两处联动，点击P1地图上的区，或者点击区域列表项，会联动到P2，这时候P2就变成该区的详情了。\n2.P1的黄色内容代表小区，蓝色内容代表栅格，地图上也可以切换两种渲染，地图的渲染按照同一色彩的浓度来表示。\n3.P1列表中可以切换小区和栅格，切换后联动到右侧的地图也跟着切换。\n4.P2页，的列表分为小区页和栅格页，通过Tab页切换。\n5.P2页，点击列表的\u201cGIS\u201d按钮，联动到GIS的放大页面。默认GIS是显示整个重庆的小区、栅格信息的。点击GIS上的栅格，弹出面板，显示相关小区信息；对于小区则相反。点击列表的\u201c详情\u201d，则显示该小区或者栅格的更多字段。\n6.P2页，点击查询栏左侧的返回箭头，返回P1页。\n7.P2页，列表下角的查询可以查询、筛选列表中的内容。\n\n其他修改点：\n1.加上地区控件；\n2.列表换成左右上下拖动的样式；\n3.首页地区的色彩标识改为：色块在前，描述在后；\n4.首页的联动是：比率饼图联动到第二页的全部地图，首页的列表、地图联动到第二页的具体区县（小区/栅格）。","PrototypeView":""},{"SerialNum":"2016053117191320719456","ProjectName":"区县满意度分析结果","PrototypeImg":":10080/xplan/images/release/2016/6/1/1464744667187","ProjectBrief":"先把2，3，4的功能实现，具体需求：\n1、电信给出一些质差用户，导入VMAX系统；\n2、系统对这些用户作分析，比如导入100个用户，系统需要根据判断条件分析出，如\n   30个用户属于方向干扰问题，50个用户属于容量问题，30个用户属于容量问题 + 覆盖问题 。\n3、判断条件可以灵活修改；\n4、涉及到4G的数据可以先不加进来；\n5、先实现功能，界面部分要求不高；\n","PrototypeView":"http://10.5.0.128/ZXVMAX/DOC/UX/原型/Q区县满意度分析/publish/index.html"},{"SerialNum":"201606011140191986987","ProjectName":"天馈检测","PrototypeImg":":10080/xplan/images/release/2016/6/1/1464762716046","ProjectBrief":"天馈检测","PrototypeView":""},{"SerialNum":"2016060216375537588216","ProjectName":"干扰分析","PrototypeImg":"../../images/index/defaultImg.png","ProjectBrief":"干扰分析\n\n修改点：\n1.增加了干扰源表示；\n2.表头和表尾固定，中间字段可以滑动显示；\n3.面板栅格显示根据真实数据显示出来更逼真；","PrototypeView":""},{"SerialNum":"2016060315393833161926","ProjectName":"sadfsadf","PrototypeImg":"../../images/index/defaultImg.png","ProjectBrief":" 撒分撒旦阿斯蒂芬asd","PrototypeView":""}]

